import React from "react";
import { useState } from "react";
const Dummy = () => {
  const [ state, setState ] = useState("Earn");
  const [ count, setCount ] = useState(4);

  function handleClick() {
    const Money = ["Earn", "Grow", "Give"];
    const int = Math.floor(Math.random() * 3);
    console.log(int)
    setState(Money[int]);
  }
  function increment() {
    setCount (count+1)
  }
  function decrement() {
    setCount (count-1)
  }


  return (
    <>
      <h1>Let {state} Money</h1>
      <button onClick={()=>handleClick()}>Click</button><br/>
      <button onClick={decrement}>Minu</button><br/>
      <span>{count}</span><br/>
      <button onClick={increment}>+</button>
    </>
  );
};
export default Dummy;
